import React from "react";
import { useState } from 'react';
import linea from '../assets/linea.png';
import helado from '../assets/helado.png';

const Body = () => {

    
  const[precios, agregarPrecio] = useState(
        [
        {id:1, nombre: "1/4kg", valor: 1000 },
        {id:1, nombre: "1/2kg", valor: 1900 },
        {id:1, nombre: "1kg", valor: 3500 },
        {id:1, nombre: "Cucurucho chico", valor: 700 },
        {id:1, nombre: "Cucurucho grande", valor: 900 },
        ]
    );
    return (
        <div>
            <div className="masthead text-black text-center titulo">
                <div className="container d-flex align-items-center flex-column">
                    <h1 className="masthead-heading text-uppercase mb-0">Heladeria Hurlingham</h1>
                    <div className="divider-custom divider-light">
                        <div className="divider-custom-line"></div>
                        <img className="helado" src={helado}/>
                        <div className="divider-custom-line"></div>
                    </div>
                </div>
            </div>
            <div className=" row sabores text-center">
                <div className="sabores-container container d-flex card">
                    {
                    precios.map(precio => (
                        <div className="d-flex">
                            <div>{precio.nombre}</div>
                            <div>{precio.valor}</div>
                        </div>
                    ))
                    }
                </div>
            </div>
        </div>
    );
}

export default Body
